import React from 'react';
import { Container } from 'react-bootstrap';
import meter1 from "../assets/img/met2.png";
import meter2 from "../assets/img/met2.png";
import meter3 from "../assets/img/met3.png";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import arrow1 from "../assets/img/arrow1.svg";
import arrow2 from "../assets/img/arrow2.svg";

export const Skills = () => {
  const responsive = {
    superLargeDesktop: {
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 5
    },
    laptop: {
      breakpoint: { max: 1024, min: 768 },
      items: 4
    },
    tablet: {
      breakpoint: { max: 768, min: 464 },
      items: 3
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 2
    }
  };

  return (
    <section className="skill" id="skills" style={{ backgroundColor: '#bcb3cb' }}>
      <Container>
        <div className="row">
          <div className="col-12">
            <div className="skill-bx wow zoomIn">
              <h2>Skills</h2>
              <p>These are the skills that i possess With expertise in computer science, <br></br>I bring a versatile toolkit to any task. I am eager to leverage these abilities <br></br>to excel in my job.</p>
              <Carousel
                responsive={responsive}
                infinite={true}
                className="owl-carousel owl-theme skill-slider"
                customLeftArrow={<img src={arrow1} alt="Arrow" />}
                customRightArrow={<img src={arrow2} alt="Arrow" />}
                showDots={false}
                autoPlay={true}
                autoPlaySpeed={3000}
                keyBoardControl={true}
                removeArrowOnDeviceType={["tablet", "mobile"]}
              >
                <div className="item">
                  <img src={meter1} alt="Web Development Skill" />
                  <h5>Web Development</h5>
                </div>
                <div className="item">
                  <img src={meter2} alt="Programming Languages Skill" />
                  <h5>C++/C,Python</h5>
                </div>
                <div className="item">
                  <img src={meter3} alt="Database Management Skill" />
                  <h5>Database management</h5>
                </div>
                <div className="item">
                  <img src={meter1} alt="Soft Skills" />
                  <h5>Soft skills</h5>
                </div>
                <div className="item">
                  <img src={meter1} alt="Leadership Skill" />
                  <h5>Leadership</h5>
                </div>
              </Carousel>
            </div>
          </div>
        </div>
      </Container>
    </section>
  );
};
